import React from 'react';
import './App.css';
class Weather extends React.Component{
  constructor(props) {
    super(props);
    this.handleClick = this.handleClick.bind(this);  }
  WeatherBtnPressed(){

  }

  render(){
    return <div classNameName="App">
      <section className="contentPanel">
        <div className="gridContainer">
            <div className="weatherForm">
                <h2>Введите <span>город</span> чтобы получить прогноз погоды</h2>
                <div id="WeatherContainer">
                    <div className="formControl">
                        <input id ="chosenCity" type="text" value="Москва" autoComplete="off"/>
                    </div>
                    <input id ="submitBtn" className="forecastBtn" onClick={this.handleClick()} type="submit" value="Показать погоду"/>
                </div>
            </div>

            <div className="forecastResult">
                <ul>
                    <li id="city"></li>
                    <hr/>
                    <li id="state"></li>
                    <li><img id="image"/></li>
                    <li id="temperature"></li>
                    <li id="feelsLike"></li>
                    <li id="wind"></li>
                    <li id="humidity"></li>
                </ul>
            </div>
        </div>
    </section>
    </div>
  }
}
function App() {
  return (
    <div></div>
  );
}

export default App;
